import React from "react";

const FoundView = ({ foundSearch }) => {
  // console.log(foundSearch);
  const searchResult =
    foundSearch &&
    foundSearch.map(({ address, imageSrc, url, city, category }, i) => {
      <div>
        <div>
          <img src={imageSrc} alt={category} />
        </div>
      </div>;
    });
  return <div></div>;
};

export default FoundView;
